import React from "react";
import Gift from "../../img/img_gallery/gift.jps";
const Gallery = () => {
  const arrangeImg = imgUrl.map((url) => {
    return <img src={url} key={url} />;
  });

  return <div>{arrangeImg}</div>;
};

export default Gallery;
